import React from 'react'
import ProductCard from './ProductCard'

export default function ProductList({products}) {
  console.log('logo', products.logo)
  return (
    <div>
      <h1>PRODUCT LIST</h1>

      <ProductCard logo={products.logo} title={products.title} price={products.price} />
    </div>
  )
}
